  useEffect(() => {
    fetch(queryURL,{
      method:"GET",
      headers:{
        "Accept":"application/json"
      }
    }).then(
        res => {
          setJokeList(res.json())
        setLoaded(true)
        }
    )
})



  return (
    <Layout title="Dad Jokes" page="dlj">
      {loaded? jokeList.map((j, i) => (
        <Jokecard joke={j} key={i} />
      )): ""}
    </Layout>
  );
}
